// data/affixes-map.js
function getIntegerCs(affix) {
  return {
    1e8: "k\u017C",
    "10000000000000000": "\u010Dg",
    1e4: "pc",
    1: "zc",
    2: "ks",
    3: "z",
    4: "p\u0161",
    5: "st",
    6: "cp",
    7: "ns",
    8: "\u010Dk",
    9: "l\u017C",
    0: "vr",
    100: "gz",
    15: "\u0163\u017C",
    14: "bc",
    13: "\u013Cj",
    12: "jd",
    11: "cg",
    10: "j"
  }["" + affix];
}

// generate/helpers/fill-defaults.js
function fillDefaults(defaultValue, additions) {
  const output = { ...defaultValue };
  for (const key2 in additions) {
    const value = additions[key2];
    if (value != null) {
      output[key2] = value;
    }
  }
  return output;
}

